import React, {Component} from 'react';

class Footer extends Component{
  render(){
    return(
      <footer id="footer" className="col-md-12 sticky-footer navbar navbar-expand-sm">
        <div className="collapse-navbar justify-content-center">
          <ul className="navbar-nav">
            <li className="navbar-item px-1 "><a className="navbar-link" href="#home">Home</a></li>
            <li className="navbar-item px-1 "><a className="navbar-link" href="#about">About Us</a></li>
            <li className="navbar-item px-1 "><a className="navbar-link" href="form">Forms</a></li>
            <li className="navbar-item px-1 "><a className="navbar-link" href="#contact">Contact Us</a></li>
          </ul>
          <p className="text-right m-0">Created By Gerard Cancino</p>
        </div>
      </footer>
    );
  }
}

export default Footer;
